export default function getVoicemailData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        type: "profile",
        index: "Profile",
        data: (() => {
          try {
            let destruct = profile['profile'];
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        index: "Name",
        data: (() => {
          try {
            let destruct = profile['data']['DisplayName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Title",
        data: (() => {
          try {
            let destruct = profile['data']['Title']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Extension",
        data: (() => {
          try {
            let destruct = profile['data']['DtmfAccessId']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Calling Search Space",
        data: (() => {
          try {
            let destruct = profile['data']['shareLineAppearanceCssName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['meta']['hierarchy']
            destruct = destruct.split("London Drugs.")[1]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "",
        index: "",
        data: ""
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retireve devices.")
  })
}
